	(206, 'P2019102109_DM_A', 0, 'P2019102109_DM_A', '丰铁', '谢涛', '2019-10-24', '立式多色机', NULL, 'APP-DSP54-C7000', 'APP-3354-Q12-54', '1', 'R2', NULL, '增加三菱伺服转盘相关信号：X74-移模异常、Y60-伺服移模使能。相关的功能输出、警报等；<br/>机械手轴转延迟0-99.9可调，此时也会在“延迟下进夹”三个时间总和以上设置，机械手退回后做；<br/>机械手夹转延迟0-99.9可调，此时会在“延迟下进夹”三个时间总和以上设置，机械手退回后做；<br/>1、机械手夹转AB-使用、机械手轴转AB-使用，开模和转塔下降到位后，才能动作，否则警报“转塔未下降、开模未到定位”。<br/>2、手动下按住“机械手”按键，需要等待“机械手进夹上”三个动作完成，退回收到“X4机械手A退终、X6机械手B退终”信号，才能有AB机械手夹转和轴转PC输出。<br/>3、机械手夹转AB-时间控制。机械手轴转AB-有PB点控制，到位信号分别为：X45-机械手轴转进终A、X46-机械手轴转退终A、X47-机械手轴转进终B、X48-机械手轴转退终B。<br/>4、自动下，需要“机械手进夹上”三个动作完成，3个延迟时间的动作总和到达，才能有AB机械手夹转和轴转PC输出。', NULL, NULL, '[]', '谢涛', '2019-10-21', '杨金鑫', '2019-10-23', 1, NULL, 1, '2019-10-23 09:54:24', NULL, 1),
