	(1, 'TP2019092901_DM_C', 0, 'TP2019092901_DM_C', NULL, NULL, '弘讯标准', '蒋伟贞', '2019-09-30', '压机', NULL, '未选择', 'OS-3354-3.12', '1', 'R1', NULL, 'os-3.12版本，需要支持压机出货硬体Q8电阻屏的触屏操作', NULL, NULL, '[{"fileName":"TMC004软件变更申请单_tm3354（烧录档）.doc","fileKey":"DAjD4ltoNwFGyhiplV8d1Kn4.doc"}]', '蒋伟贞', '2019-09-29', '孙凌财', NULL, 0, NULL, 0, '2019-09-29 13:14:58', NULL, 1),
	(2, 'TP2019092903_DM_C', 0, 'TP2019092903_DM_C', NULL, NULL, '弘讯标准', '周永汉', '2019-10-02', '压机', NULL, '未选择', 'OS-3354-3.12', '1', 'R2', NULL, '压机上需要使用8寸A版的3354电阻屏硬件，请修改对应的烧录档程序。', NULL, NULL, '[]', '周永汉', '2019-09-29', '蒋伟贞', '2019-09-29', 1, NULL, 1, '2019-09-29 17:29:54', NULL, 1),
	(3, 'TP2019101101_DP_C', 0, 'TP2019101101_DP_C', 'T2019101014_HK_02', 'T2019101014_HK_02', '海天', '周永汉', '2019-10-11', '普通机', NULL, '未选择', 'Kernel-3354-Q15-55', '1', 'R1,R2', NULL, 'mmi修改支持鼠标功能', NULL, NULL, '[]', '周永汉', '2019-10-11', '蒋伟贞', '2019-10-11', 2, '方案说明不够详细，讲明具体处理方案，问题原因', 0, '2019-10-11 08:44:57', NULL, 1),
	(4, 'TP2019101101_DP_C', 1, 'TP2019101101_DP_C', 'T2019101014_HK_02', 'T2019101014_HK_02', '海天', '周永汉', '2019-10-11', '普通机', NULL, '未选择', 'Kernel-3354-Q15-55', '1', 'R1,R2,R3,R5', NULL, '1、mmi修改支持鼠标功能；<br/>2、解决鼠标连着，触摸操作会异常、触摸操作会导致鼠标箭头位置乱跳的问题。<br/>原app程序中读取/dev/input/mice来获得鼠标信息。mice是所有鼠标的合体，所有鼠标信息都会发给它一份，由于电容屏会被驱动识别为mouse设备，在触摸操作时会往mice中也写入信息，导致上述问题。现更正为自动查找并抓取"/dev/input/mouseX"，X=0、1……', NULL, NULL, '[]', '周永汉', '2019-10-11', '蒋伟贞', '2019-10-11', 1, NULL, 1, '2019-10-11 09:08:15', NULL, 1),
	(5, 'TP2019101102_DP_C', 0, 'TP2019101102_DP_C', NULL, NULL, '恩瑞德', '张磊', '2019-10-14', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R2', NULL, 'XPLC2修改', NULL, NULL, '[]', '张磊', '2019-10-11', '许静静', '2019-10-11', 1, NULL, 1, '2019-10-11 11:03:33', NULL, 1),
	(6, 'TP2019101201_DM_A', 0, 'TP2019101201_DM_A', NULL, NULL, '海天', '傅霞银', '2019-11-12', '普通机', NULL, '未选择', 'OS-3354-3.12', '1', 'R1', NULL, '可输入数字和字母的edit元件，触摸输入时，弹出的小键盘用全键盘显示；', NULL, NULL, '[]', '傅霞银', '2019-10-12', '蒋伟贞', '2019-10-12', 1, NULL, 1, '2019-10-12 09:59:42', NULL, 1),
	(7, 'TP2019101501_DP_C', 0, 'TP2019101501_DP_C', 'T2019101111_HK_01', 'T2019101111_HK_01', 'iNet', '周永汉', '2019-10-18', '普通机', NULL, '未选择', 'Kernel-3354-Q12-55', '1', 'R1', NULL, '核心中将tmControl_MoldHyb5.cpp中的：<br/>BYTE*	CtmControl_Mold::GetMoldSetContent()<br/>{<br/>	return	m_pContent;<br/>}<br/>接口函数增加一个参数用于返回m_pReadContent', NULL, NULL, '[]', '周永汉', '2019-10-15', '蒋伟贞', '2019-10-17', 1, NULL, 1, '2019-10-15 12:59:21', NULL, 1),
	(8, 'TP2019101601_DP_C', 0, 'TP2019101601_DP_C', 'T2019101612_DK_04', 'T2019101612_DK_04', '余姚海晶', '张磊', '2019-10-19', '普通机', NULL, 'Kernel-DSP54-7100（7HT卧式机）', '未选择', '1', 'R2', NULL, '近期遇到多家客户需要开模完 做中子进退，再脱模的流程，请参考开宇程序 把特殊中子逻辑加入到核心标配，谢谢，请默认中子进退1次，若客户需要多次，请面板开放', NULL, NULL, '[]', '张磊', '2019-10-16', '张磊', '2019-10-16', 1, NULL, 1, '2019-10-16 16:44:32', NULL, 1),
	(9, 'TP2019101801_DP_C', 0, 'TP2019101801_DP_C', 'T2019101802_DK_01', 'T2019101802_DK_01', '双盛/圣特龙', '张磊', '2019-10-23', '卧式多色机', NULL, 'Kernel-DSP54-7900（双色机）', '未选择', '1', 'R1,R3', NULL, '功能优化：储料B第五段子状态显示（OPER.SUBS+1=5000H）。', NULL, NULL, '[]', '张磊', '2019-10-18', '张磊', '2019-10-18', 1, NULL, 1, '2019-10-18 14:00:35', NULL, 1),
	(10, 'TP2019101602_DP_C', 0, 'TP2019101602_DP_C', 'T2019101016_DK_03', 'T2019101016_DK_03', '恩瑞德', '张磊', '2019-10-12', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R2', NULL, '	计划单要求:<br/>特殊开模功能选项增加<br/>8-开模1234段<br/><br/>XPLC2修改<br/>任务单要求:<br/>MACH-23A 特殊开模功能选择 选项新增开模1234段', NULL, NULL, '[]', '张磊', '2019-10-21', '张磊', '2019-10-21', 1, NULL, 1, '2019-10-21 15:59:16', NULL, 1),
	(11, 'TP2019102103_DM_C', 0, 'TP2019102103_DM_C', NULL, NULL, '弘讯标准', '周永汉', '2019-10-24', '普通机', NULL, '未选择', 'Kernel-3354-Q12-55', '1', 'R2', NULL, 'mmi增加一个全局变量，用于记录当前页面名称。', NULL, NULL, '[]', '周永汉', '2019-10-21', '蒋伟贞', '2019-10-22', 1, NULL, 1, '2019-10-21 16:32:35', NULL, 1),
	(12, 'TP2019102201_DP_C', 0, 'TP2019102201_DP_C', 'T2019102206_DK_03', 'T2019102206_DK_03', '海达', '张磊', '2019-10-25', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R3', NULL, '(191022)1、功能新增：增加润滑1 润滑2 润滑4 子状态。<br/>           ;;       STAT.SUBS2+0<br/>           SSU0_LUB1 .SET     5  ; "润滑1"             "3354按键灯+子状态"         ;;ZHL20191022<br/>           SSU0_LUB2 .SET     6  ; "润滑2"             "3354按键灯+子状态"         ;;ZHL20191022<br/>           SSU0_LUB4 .SET     7  ; "润滑4"             "3354按键灯+子状态"         ;;ZHL20191022<br/>           来源：王浩宇 ', NULL, NULL, '[]', '张磊', '2019-10-22', '张磊', '2019-10-22', 1, NULL, 1, '2019-10-22 14:23:02', NULL, 1),
	(13, 'TP2019102101_DM_C', 0, 'TP2019102101_DM_C', NULL, NULL, '海天', '李斌', '2019-10-24', '普通机', NULL, 'Kernel-DSP54-7100（7HT卧式机）', '未选择', '1', 'R1', NULL, 'xplc2.asm处理<br/>模具頂退功能<br/>       逻辑要求：关模，中子进，中子退时检测 I_MLD_BWD 为ON，否则警报。<br/>目前：脱模停留时，也会检测。需要更改为 停留的脱模退，不检测此功能。<br/>', NULL, NULL, '[]', '李斌', '2019-10-23', '李斌', '2019-10-23', 1, NULL, 1, '2019-10-23 13:43:21', NULL, 1),
	(14, 'TP2019102501_DM_C', 0, 'TP2019102501_DM_C', NULL, NULL, '弘讯标准', '周永汉', '2019-10-28', '收卷机', NULL, '未选择', 'Kernel-3354-Q12-PLC', '1', 'R5', NULL, '查找在所有页面touch空白的地方，过一定时间，会出现一个”删除”的按键键值的原因并修正。', NULL, NULL, '[]', '周永汉', '2019-10-25', '蒋伟贞', '2019-10-28', 1, NULL, 1, '2019-10-25 11:00:41', NULL, 1),
	(15, 'TP2019111301_DM_C', 0, 'TP2019111301_DM_C', NULL, NULL, '海雄', '张磊', '2019-11-14', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R1,R2', NULL, '海雄厂内部分机器：高压过程中 启动安全阀会把主机板电压拉低 导致PB关模终得电，关模立即结束 做射出动作。<br/>解决方案：PB关模终增加10ms滤波时间。', NULL, NULL, '[]', '张磊', '2019-11-15', '许静静', '2019-11-15', 1, NULL, 1, '2019-11-15 08:22:59', NULL, 1),
	(16, 'TP2019111501_DM_C', 0, 'TP2019111501_DM_C', NULL, NULL, '海天', '张凯', '2019-11-18', '普通机', NULL, 'Kernel-DSP54-7100（7HT卧式机）', '未选择', '1', 'R1', NULL, '粗调模式下做开模动作，模座起始位置已在开模终，直接结束开模动作。', NULL, NULL, '[]', '张凯', '2019-11-15', '李斌', '2019-11-15', 1, NULL, 1, '2019-11-15 08:41:51', NULL, 1),
	(17, 'TP2019111503_DM_C', 0, 'TP2019111503_DM_C', NULL, NULL, '海天', '张凯', '2019-11-18', '普通机', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '1', 'R2', NULL, '  新增：關模減速相關<br/>         *         STAT.HYDR_CLSP            ;;(PAUL20161122)<br/>         F_CMPX_M_STT  .SET   7              ; 複合機關模定位低壓終位置<br/>         新增資料  <br/>         *;; MACH  ALGORITHM2<br/>         ALGM2_CMPXGAIN .WORD   ;115                複合機關模補償<br/>         複合機使用關模定位,F_CMPX_M_STT=1,定位位置為低壓終位置，補償使用MACH.ALGM2_CMPXGAIN<br/>          XPLC1&XPLC2.ASM配合處理', NULL, NULL, '[]', '张凯', '2019-11-15', '李斌', '2019-11-15', 1, NULL, 1, '2019-11-15 08:53:40', NULL, 1),
	(18, 'TP2019111502_DM_C', 0, 'TP2019111502_DM_C', NULL, NULL, '海天', '张凯', '2019-11-18', '普通机', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '1', 'R1', NULL, '开模过程中，做中子或中途机械手动作完成后，不再重新开始计时<br/><br/>开模动作完成后，開模完延遲計時(MACH.OPNM_END_DLY)前结束开模动作计时', NULL, NULL, '[]', '张凯', '2019-11-15', '李斌', '2019-11-15', 1, NULL, 1, '2019-11-15 09:12:11', NULL, 1),
	(19, 'TP2019111504_DM_C', 0, 'TP2019111504_DM_C', NULL, NULL, '海天', '张凯', '2019-11-18', '二板机', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '1', 'R1', NULL, '1、关模过程中模板位置为负位置时，仍进入中途中子判断<br/>2、关模起始模板位于负位置时，关模中子保护顺序预设为关模终点最后动作', NULL, NULL, '[]', '张凯', '2019-11-15', '李斌', '2019-11-15', 1, NULL, 1, '2019-11-15 13:59:30', NULL, 1),
	(20, 'TP2019112001_DM_A', 0, 'TP2019112001_DM_A', NULL, NULL, '海天', '张凯', '2019-11-23', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R1', NULL, ' 開模完延遲計時(MACH.OPNM_END_DLY)不计入开模计时<br/>', NULL, NULL, '[]', '张凯', '2019-11-20', '李斌', '2019-11-20', 1, NULL, 1, '2019-11-20 12:50:25', NULL, 1),
	(29, 'TP2019112002_DM_A', 0, 'TP2019112002_DM_A', NULL, NULL, '海天', '张凯', '2019-11-23', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R1', NULL, '         进料口切断动作时，脱模不检测中子状态<br/>         进料口切断动作未做脱模退时，中子动作不检测脱模状态', NULL, NULL, '[]', '张凯', '2019-11-20', '李斌', '2019-11-20', 1, NULL, 0, '2019-11-20 12:52:25', NULL, 1),
	(30, 'TP2019112004_DM_C', 0, 'TP2019112004_DM_C', NULL, NULL, '弘讯标准', '周永汉', '2019-11-25', '双架连续式', NULL, '未选择', 'Kernel-3354-Q12-55', '1', 'R3', NULL, '原zoom属性放大功能，是把字体往右和往下进行放大，这样放大后看起来不是很协调。<br/>现需要把字体往上下左右进行放大。', NULL, NULL, '[]', '周永汉', '2019-11-21', '蒋伟贞', '2019-11-21', 1, NULL, 1, '2019-11-21 08:48:22', NULL, 1),
	(31, 'TP2019112003_DM_C', 0, 'TP2019112003_DM_C', NULL, NULL, '海雄', '张磊', '2019-11-23', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R2', NULL, '核心增加标记用于XPLC跳过 粗调开模检查开模终点的逻辑。', NULL, NULL, '[]', '张磊', '2019-11-21', '张磊', '2019-11-21', 1, NULL, 1, '2019-11-21 13:05:05', NULL, 1),
	(32, 'TP2019112701_TM_A', 0, 'TP2019112701_TM_A', NULL, NULL, '弘讯标准', '周永汉', '2019-11-30', '未选择', NULL, '未选择', 'OS-3354-3.2', '2', NULL, NULL, '程序已有不用处理', NULL, NULL, '[]', '周永汉', '2019-11-28', '周永汉', '2019-11-28', 1, NULL, 1, '2019-11-28 09:47:52', NULL, 1),
	(33, 'TP2019112601_DM_A', 0, 'TP2019112601_DM_A', NULL, NULL, '海天', '张凯', '2019-11-29', '普通机', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '1', 'R2', NULL, '功能新增：開關模曲線相關<br/>           開關模速度計算前，增加推力座轉換功能。<br/>            MACH4_STRU.STRUCT<br/>            *;; MACH4 CROSS<br/>            CRS_MLD_CH .WORD<br/>            CROSS_CHX .WORD 100H<br/>            *;; MACH4 MOLD<br/>            MOLD_CHX .WORD 100H<br/>', NULL, NULL, '[]', '张凯', '2019-11-28', '李斌', '2019-11-28', 1, NULL, 1, '2019-11-28 12:50:15', NULL, 1),
	(34, 'TP2019112801_DM_A', 0, 'TP2019112801_DM_A', NULL, NULL, '海天', '张凯', '2019-12-01', '普通机', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '1', 'R1,R2', NULL, '功能調整：射出曲線相關 (X7HT)<br/>           射出使用J6PLUS控制時，射出曲線採樣時間精度由COA_SPDTE或MC2_PRECIS控制<br/>           儲料曲線採樣時間精度保留原邏輯。<br/><br/>功能新增：<br/>           *           A_XCODE+0  @60H   (CODE:@C0-0000)<br/>           XC0_J6PADD  .SET     9   ;0200 1: 無配置J6PLUS亦執行相關通續解析邏輯<br/><br/>', NULL, NULL, '[]', '张凯', '2019-11-28', '李斌', '2019-11-28', 1, NULL, 1, '2019-11-28 12:52:07', NULL, 1),
	(35, 'TP2019112002_DM_A', 1, 'TP2019112002_DM_A', NULL, NULL, '海天', '张凯', '2019-11-23', '普通机', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '1', 'R1', NULL, '         进料口切断动作时，脱模不检测中子状态<br/>         进料口切断动作未做脱模退时，中子动作不检测脱模状态', NULL, NULL, '[]', '张凯', '2019-12-25', '许静静', NULL, 0, NULL, 0, '2019-11-29 16:13:50', NULL, 1),
	(36, 'TP2019120201_DM_C', NULL, 'TP2019120201_DM_C', NULL, NULL, '奇明', '熊奇龙', '2019-12-05', '卧式多色机', NULL, 'Kernel-DSP54-7100（7HT卧式机）', '未选择', '1', 'R2', NULL, '123123123123', NULL, NULL, '[]', '熊奇龙', '2019-12-20', '熊奇龙', NULL, 0, NULL, 0, '2019-12-20 12:57:22', NULL, 1),
