	(43, 'P2019100801_DM_A', 0, '泰瑞', NULL, 'D', 'M', 'A', 'Q8A画面优化', '下面是新的3354系统的画面修改项，请尽快完成，谢谢！<br/>1.开机画面:"杭州经济技术开发区"改成"杭州钱塘新区"<br/>2.模座画面:浮动缸和开关模延迟放入模座功能画面<br/>3.模座参数画面:所有"Ramp"词条都改中文"斜率"，包括其他画面<br/>4.模座特参画面:十字头位置，模座位置删掉<br/>5.注射画面:"延迟时间"改"注射延时"，放入功能画面<br/>6.注射画面:注射时间没法设置<br/>7.储料画面:"延迟时间"改"储料延时"<br/>8.射出特参画面:液压喷嘴，射出喷嘴，蓄能器功能选择放入射出功能画面<br/>9.射出功能画面:射出段数，保压段数放入射出特参画面<br/>10.储料画面:射退模式没法选<br/>11.脱模画面:脱进时间，放到功能画面，改"脱进时间控制"<br/>12.中子画面:射出中子保持默认不保持<br/>13.特殊中子:"help"改"代码"<br/>14.中子参数画面:有选择框无法选择，"help"改"说明"<br/>15.座台画面:"动作单伺服"当配了这个输出点时再显示<br/>16.温度画面:料筒画面做优化，不好看<br/>17.调模参数画面:调模选择位置时再显示"位置调模比"，"调模位置","模具现在位置".<br/>18.其他画面:机铰删掉<br/>19.版本画面:120,140这两行改成1a0,2f0.<br/>20.建置画面:使用最新的锁机密码方案<br/>21.组态画面:控制码框加入原先新增了5个，但只用了1个，可以在控制码后面增加两个框<br/>22.警报和提示信息和原先一样放到画面下方<br/><br/>泰瑞机器 陆晨风', '王锋', '王锋', NULL, NULL, '未选择', '2019-10-08', '2019-10-19', '谢丽君', '谢丽君', NULL, '未选择', 'APP-3354-Q8-54', '2019-10-08', '2019-10-08', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-08 08:34:35', NULL, NULL, 1),
