	(172, 'P2019101104_DM_A', 1, '杭州胜源', NULL, 'D', 'M', 'A', '杭州胜源程式修改', '1、输入输出点名字修改：PB6特殊11改为“侧面安全罩电眼”；PC48特殊指定五改为”送带使能”；PC43料带夹改为夹带；机械手输入输出点取消掉，<br/>2、其他参数画面只保留电机启动时间这排（泵浦、速度段、润滑统统删除）<br/>3、关模动作动作过程中，走低压位置时，主页面动作图标显示是压膜，应该显示低压、高压。<br/>4、送带、倒带动作时，动作实际一直显示的是拉带，应该区分送带、送带慢速、倒带、倒带慢速；倒带终到了，按倒带，有提示倒带已到位<br/>5、温度增加自学习PID<br/>6.所有动作显示字串与实际动作一致，麻烦仔细检查下。', '谷永亮', '谷永亮,方林杰', NULL, NULL, '未选择', '2019-10-11', '2019-10-21', '谢丽君', '谢丽君', NULL, 'APP-DSP54-AK618', '未选择', '2019-10-18', '2019-10-18', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-18 14:00:56', NULL, NULL, 0),
	(173, 'P2019101606_DW_A', 1, '德耐', NULL, 'D', 'W', 'A', '功能优化', '冷却切马达，有座退动作时，座退做完再做切马达动作', '谷永亮', NULL, NULL, NULL, '未选择', '2019-10-16', '2019-10-19', '谢丽君', '谢丽君', NULL, 'APP-DSP54-AK628', '未选择', '2019-10-18', '2019-10-18', 2, NULL, NULL, NULL, '[]', 0, '', NULL, 0, 0, 0, 2, 0, '2019-10-24', 0, '2019-10-18 14:39:02', NULL, NULL, 1),
	(174, 'P2019102101_DM_A', 0, '德耐', NULL, 'D', 'M', 'A', '功能修改', '谷工你好： <br/>此程序和客户沟通后还需更改，其它不变就是输入输出要重新做如下：输入要的点1，机械手通讯 2，抓件完成 3，放件完成 4，有铁芯 5，顶针到位 <br/>输出要的点1，正常通讯 2，请求抓件 3，请求放件 <br/>注：1，输入输出1是指机械手臂和注塑通讯正常互给的一个信号。2，当输入有铁芯和顶针到位时，输出请求抓件，当输入抓件完成时停止输出请求抓件。当只有顶针到位信号时输出请求放件，当放件完成时请求放件停止输出同时注塑机下一个循环开始。3，满足的条件也是在机械手臂选择使用和顶针选择停留时。<br/>原版本：<br/>主机：X7EA73079.J9P<br/>面板：7TM_B14_199O_update、7TM_B149_18C6_update', '谷永亮', '谷永亮,方林杰', NULL, NULL, '普通立式机', '2019-10-21', '2019-10-24', '谢丽君', '谢丽君', NULL, 'APP-DSP54-AK618', 'APP-PXA270-Q8-54', '2019-10-21', '2019-10-21', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-21 08:37:48', NULL, NULL, 1),
