	(202, 'P2019102204_DM_A', 0, '杭州爱科', NULL, 'D', 'M', 'A', 'Q8面板整合', '要求：<br/>1、合模各段的斜率现程序是无效的，需要改为有效；<br/>2、射出延时，顶针动作页面顶针进延时和顶退延时，低压延迟进，低压阀延迟，高压延迟进，高压保持计时，首次座台进慢速计时现设定均为无效；<br/>3、手动状态下，按转盘，到位后定位进未自动进；<br/>4、参数页面左右转微调取消；<br/>5、中子进延时设定后，只延时了中子阀，中子PQ和状态还是在输出；<br/>6、转盘页面的中速和设定三组的背压取消，改为标准的转盘画面；<br/>7、转盘参数画面的转模背压移至转盘的动作页面；<br/>8、转盘页面的转盘速度比例改为伺服转盘速度；<br/>9、在顶针的动作画面增加右顶针进和右顶针退动作延时计；<br/>10、托模方式增加保持，当选择保持时，顶针进动作的PQ为顶进二的PQ；<br/>11、座台进比例阀延迟切改为座台进比例阀延迟进；<br/>12、储料页面的残料修正功能取消', '张磊', '张磊,虞晔文', NULL, NULL, '未选择', '2019-10-22', '2019-10-30', '谢丽君', '谢丽君', NULL, 'APP-DSP54-TECH 2/2S', '未选择', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-22 09:49:09', NULL, NULL, 1),
	(203, 'P2019102205_DW_A', 0, '奇明', NULL, 'D', 'W', 'A', '奇明程序修改', '一、增加PB32点限位功能，根据PB<br/> on/off，判断自动按键起作用或不起作用。<br/>二、增加左右开关模监测计时。<br/><br/>原版本：7JM_B1A_1864', '方林杰', '方林杰', NULL, NULL, '未选择', '2019-10-22', '2019-10-25', '谢丽君', '谢丽君', NULL, '未选择', 'APP-PXA270-Q8-54', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-22 09:50:57', NULL, NULL, 1),
