	(211, 'P2019102211_DM_A', 0, '新海太', NULL, 'D', 'M', 'A', '增加中子、气阀', '在不使用扩展板基础上有TECH1，TECH2电脑更改增加中子，气阀。<br/>7001B，中子D组：PC   27,28<br/>                             PB   31,32<br/>7001A，气阀C,D组：PC  23,26<br/>              中子C,D组：PC  18  24 25 27 <br/>                                 PB   9  13  22  24     <br/>新海太-京琼机械-朱工<344948999@qq.com><br/>', '柳张成', '柳张成', NULL, NULL, '未选择', '2019-10-22', '2019-10-25', '谢丽君', '谢丽君', NULL, 'APP-DSP54-TECH 1/1S/HYB', '未选择', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[{"fileName":"7XHA7001A.J5G","fileKey":"Am9UvrD1kcjTRnC5gK9pCebW.J5G"},{"fileName":"7XHA7001B.J43","fileKey":"iD6paNNM8Sm3tJ-mwUoCp9-5.J43"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-22 16:15:09', NULL, NULL, 1),
	(212, 'P2019102212_DM_A', 0, '海天', NULL, 'D', 'M', 'A', '2019海天-124  15寸双色机更改', '由于IAIII转盘机定位销改为侧定位，转模参数画面新增两笔资料<br/>SLANT_LOCT_PRS  .SET  MACH_STRU.OTHER+37H     ;(3B7H)侧定位压力   ;;SLANT LOCATE PRES     <br/>SLANT_LOCT_FLW .SET   MACH_STRU.OTHER+38H     ;(3B8H)侧定位流量   ;;SLANT LOCATE FLOW        <br/>压力默认值80，上限系统压力，下限0<br/>流量默认值20.0，上限系统流量，下限0<br/>同时隐藏定位压力、定位流量、定位进保持计时<br/>有不明事宜请联系陈旭<br/> <br/>', '周颖', '周颖', NULL, NULL, '未选择', '2019-10-22', '2019-10-25', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-22 16:21:49', NULL, NULL, 0),
