	(214, 'P2019102213_DM_A', 0, '捷泰', NULL, 'D', 'M', 'A', '15寸双色机更改', '原始程序，TECH2插装主机：7JXA71005.J9B<br/>                 12寸面板：7JX_611_199G<br/>主机修改内容：1、将PC02点改为“零背压”：在使用比例背压并且背压设置大于0时，PC02零背压与储料同步输出；<br/>                        2、将PC22点改为开模快速，在面板上选择开模快速：在开模的第2、第3、第4段时，PC22开模快速同时输出；<br/>                        3、将PC26点改为保压：保压动作时输出。<br/>面板修改内容：注射功能页面增加注射气阀选择（选择控制方式与7JX_B11_1852_update中相同），用于控制PC31点输出<br/>捷泰-龚达川<599246646@qq.com>', '沈航凯', '沈航凯,沈航凯,张铖', NULL, NULL, '未选择', '2019-10-22', '2019-10-25', '谢丽君', '谢丽君', NULL, 'APP-DSP54-TECH 2/2S', '未选择', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-11-01', 0, '2019-10-22 16:28:59', NULL, NULL, 0),
