	(216, 'P2019101104_DM_A', 2, '杭州胜源', NULL, 'D', 'M', 'A', '杭州胜源程式修改', '胜源程序再次优化如下：<br/>1.紧急回升，改为按下紧急回升，按位置开模到底，自动停下，按下手动消除警报，面板功能画面里紧急回升时间取消掉。<br/>2.画面参数默认优化，温度默认选用3段，温度设定第一段默认180，第二段175，第三段175，；开模位置有效区默认为15，拉带画面压力流量参数默认为0,<br/>3.开关模默认都选用三段，且关模显示压模改为关模低压，模座参数一画面，开合模首段压力流量ramp默认为0.05，其他全为0<br/>杭州办_徐丁庆<xdq_dq@163.com>', '谷永亮', '谷永亮,方林杰', NULL, NULL, '未选择', '2019-10-11', '2019-10-25', '谢丽君', '谢丽君', NULL, 'APP-DSP54-AK618', '未选择', '2019-10-23', '2019-10-23', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-23 08:19:10', NULL, NULL, 1),
