	(254, 'P2019102808_DM_A', 0, '宁波力劲', NULL, 'D', 'M', 'A', '特供机出机单NP190408修改要求', 'TO:弘讯    王浩宇<br/>Fr:宁波力劲   杨琴<br/> <br/>根据特供机出机单NP190408要求：PT250/P79562910#配弘讯TECH2S_Q12A电脑，加装三色报警灯、增加料筒冷却风机、开放OPC UA 联网授权、配数字式电表。电脑程序需更改<br/><br/>', '王浩宇', '孙维泽,王涛', NULL, NULL, '未选择', '2019-10-28', '2019-10-31', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[{"fileName":"特供_3组抽芯_三色报警灯_安全光幕_OPC(TECH2S-Q12A).doc","fileKey":"SrUszURffYFxCQg1YjwTB2Ll.doc"}]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-28 11:10:37', NULL, NULL, 0),
