	(256, 'P2019102212_DM_A', 2, '海天', NULL, 'D', 'M', 'A', '2019海天-124  15寸双色机更改', '由于IAIII转盘机定位销改为侧定位，转模参数画面新增两笔资料<br/>SLANT_LOCT_PRS  .SET  MACH_STRU.OTHER+37H     ;(3B7H)侧定位压力   ;;SLANT LOCATE PRES     <br/>SLANT_LOCT_FLW .SET   MACH_STRU.OTHER+38H     ;(3B8H)侧定位流量   ;;SLANT LOCATE FLOW        <br/>压力默认值80，上限系统压力，下限0<br/>流量默认值20.0，上限系统流量，下限0<br/>同时隐藏定位压力、定位流量、定位进保持计时<br/>有不明事宜请联系陈旭<br/>沟通至28号给<br/> <br/>', '周颖', '周颖', NULL, NULL, '未选择', '2019-10-22', '2019-10-29', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[{"fileName":"2019海天-124.docx","fileKey":"Q4LMCAlak13yqhr2EogM1Cbr.docx"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-28 12:46:06', NULL, NULL, 1),
	(257, 'P2019102810_DM_A', 0, '东莞大禹', NULL, 'D', 'M', 'A', '东莞大禹程序修改', '修改 7TYB07G174S,7TYB17174S,7TYA72052J8M,领航1+Q8<br/>一， 2工位转盘机，ASTON伺服转盘，系统油压(大泵），托模，定位(小泵第3通道）<br/>二， 1,放件机械手（托模区）  2,送料机械手（合模区）   3,清料机械手（合模区）<br/>三， 单独定位，无座台动作,合模托模同步。<br/>四， 加热油缸，夹紧油缸分A,B二组<br/>        流程见附件<br/>五 ,  上托退未到位不能合模', '陈浩天', NULL, NULL, NULL, '未选择', '2019-10-28', '2019-11-30', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[{"fileName":"程序.pdf","fileKey":"sOXSJBE2Cgcwc6YBUh8hLlZn.pdf"}]', 0, '', NULL, 0, 0, 0, 1, 90, '2019-11-05', 0, '2019-10-28 13:03:49', NULL, NULL, 1),
	(258, 'P2019102811_DT_A', 0, '宁波力劲', NULL, 'D', 'T', 'A', '力劲程序修改', '从7LKA70310.J85基础上，修改为非弘讯伺服，去掉网络通讯。', '王浩宇', '王浩宇', NULL, NULL, '未选择', '2019-10-28', '2019-10-31', '谢丽君', '谢丽君', NULL, 'APP-DSP54-TECH 2/2S', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-28 15:46:14', NULL, NULL, 1),
	(259, 'P2019102812_DM_B', 0, '宁波恩格', NULL, 'D', 'M', 'B', '临沂办-恩格主机程序修改（2019-10-28-001）', ' 附件为版本和IO点。    <br/>原程序的问题是1、关模高压检测到电子尺为零和关模终亮了之后，即使动模板回弹，关模终灭了，我们没有报警。2、关模到底后射出时，PB06关模终这个点灭了，但是我们电脑也没有报警关模未到定位，代理这边产品会飞边，他们需要确认是否胀模。<br/>故程序帮修改一下：从关模到底之后检查关模终这个点之后一直到射出结束，全程检测PB06关模终，一旦没有信号了，马上报警关模未到定位。<br/>麻烦了，有疑问请电话联系我 15757482857    TM.NB-龚文杰<xinjiang008@163.com><br/>', '沈航凯', NULL, NULL, NULL, '未选择', '2019-10-28', '2019-10-31', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[]', 0, '', NULL, 0, 0, 0, 1, 0, '2019-10-29', 0, '2019-10-28 15:50:02', NULL, NULL, 0),
	(260, 'P2019102812_DM_B', 1, '宁波恩格', NULL, 'D', 'M', 'B', '临沂办-恩格主机程序修改（2019-10-28-001）', ' 附件为版本和IO点。    <br/>原程序的问题是1、关模高压检测到电子尺为零和关模终亮了之后，即使动模板回弹，关模终灭了，我们没有报警。2、关模到底后射出时，PB06关模终这个点灭了，但是我们电脑也没有报警关模未到定位，代理这边产品会飞边，他们需要确认是否胀模。<br/>故程序帮修改一下：从关模到底之后检查关模终这个点之后一直到射出结束，全程检测PB06关模终，一旦没有信号了，马上报警关模未到定位。<br/>麻烦了，有疑问请电话联系我 15757482857    TM.NB-龚文杰<xinjiang008@163.com><br/>', '沈航凯', NULL, NULL, NULL, '未选择', '2019-10-28', '2019-10-31', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[{"fileName":"微信图片_20191028124854.jpg","fileKey":"NadjUFknPsTwyMpKZOBJNYoa.jpg"},{"fileName":"微信图片_20191028124923.jpg","fileKey":"1ou0Q_LJIGAQDFBBbulgmA_w.jpg"},{"fileName":"微信图片_201910281249231.jpg","fileKey":"R2ukMRLlprtO60BHmuLc2ux6.jpg"},{"fileName":"微信图片_201910281249232.jpg","fileKey":"7487ya4J9roH2PbgahmikZAL.jpg"},{"fileName":"微信图片_201910281249233.jpg","fileKey":"f2lQaUhKWh51s9gyb3jzDulG.jpg"}]', 0, '', NULL, 0, 0, 0, 1, 0, '2019-10-29', 0, '2019-10-28 15:50:17', NULL, NULL, 1),
	(261, 'P2019102813_DM_A', 0, '日进', NULL, 'D', 'M', 'A', '日进清双油压转盘面板程序修改', '日进617面板新增以下修改内容，版本见附件：<br/>1、系统画面可设推力座<br/>2、转模F6参数画面 开放资料：<br/>转盘延迟切计时  0~9.99 默认0.5s<br/>3、转模F5功能画面 字串更改：转盘模式 0-NET 1-IO<br/>4、转模F5功能画面 开放功能选项：<br/>  编码器转盘 0-不用 1-使用<br/>=0时，转模画面以下参数可编辑<br/>=1时，转模画面以下参数不可编辑<br/><br/><br/>', '孙维泽', '孙维泽,王锋', NULL, NULL, '未选择', '2019-10-28', '2019-11-15', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-28', '2019-10-28', 1, NULL, NULL, NULL, '[{"fileName":"邮件截图.png","fileKey":"tDy7DpsC4knrx_vagaW7wAuE.png"}]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-10-28 16:41:39', NULL, NULL, 1),
