	(268, 'P2019102905_DM_A', 0, '杭州大禹', NULL, 'D', 'M', 'A', 'TY600.2R.SF.J-190816', '麻烦你在此程序上修改一下功能:<br/>Y17吹气A1;Y18吹气A2;Y26吹气A3<br/>Y27吹气B1;Y29吹气B2;Y30吹气B3<br/>动作要求:<br/>吹气A1在开模前输出时间控制(时间画面可以设定)                   左终(跟开销同步动作)<br/>吹气A2在开模后输出时间控制(时间画面可以设定)                   左终(位置设定)<br/>吹气A3在转盘到位定位进终后输出时间控制(时间画面可设定)  右终<br/>吹气B1在开模前输出时间控制(时间画面可以设定)                   右终(跟开销同步动作)<br/>吹气B2在开模后输出时间控制(时间画面可以设定)                   右终(位置设定)<br/>吹气B3在转盘到位定位进终后输出时间控制(时间画面可设定) 左终<br/>开模 与储料动作同步,开模到位储料还在没有结束时,按启动按钮直接进入下一个循环,当合模完成射出前判断储料有没有结束,储料完后才允许注射.(在开模到位到注射前可以一直储料,直到储料到达设定位置)<br/>三.修改半自动第一模使用调模压力流量,第二模使用设定压力流量.<br/>麻烦你在2019年10月31号回复   韩智敏', '陈浩天', '陈浩天', NULL, NULL, '未选择', '2019-10-29', '2019-11-01', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-10-29', '2019-10-29', 1, NULL, NULL, NULL, '[{"fileName":"7TYA70436.JAC","fileKey":"ijX_m6yLPnUIUM-0QTT7tMfr.JAC"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-10-29 12:32:54', NULL, NULL, 1),
