	(409, 'P2019111203_DM_B', 0, '东莞大禹', NULL, 'D', 'M', 'B', '昆山大禹客户需修改程序', '昆山大禹客户油电机为配合自动化流程客户要求程序作如下修改：<br/>1.下脱模进和退都需要由机器人给电脑才能输出动作；<br/>2.关模完成后，机器人投料完成后给电脑信号开始注射；<br/>3.开模时，上脱模走到二段的位置（一共3段）停止，并给机器人一个信号，机器人手爪伸进后会给注塑机信号，然后接着第三段上脱模进到位，<br/>机器人再给一个信号控制射出和射退，<br/>4.上托模退时先退到一段，机器人清扫完毕再给一个信号，接着第二段上托退到位，再给一个信号射退到位，再给一个信号座台退到位。目前面板<br/>上脱模退面板只有一段，需要再开放一段。<br/>5.PB11—PB15,PB45—PB48都是空点没接线可以借用<br/>6.版本见附近<br/>7.大禹售后陈辉15062681153，客户端张工17671445770<br/> <br/>无锡办Tech<techwx@techmation.com.tw>', '陈浩天', '陈浩天', NULL, NULL, '未选择', '2019-11-12', '2019-11-15', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-12', '2019-11-12', 1, NULL, NULL, NULL, '[{"fileName":"mmexport1573461304875.jpg","fileKey":"NTGcSx6tjz1zI-MO30U4xSUH.jpg"},{"fileName":"mmexport1573461312993.jpg","fileKey":"QRs_NIN1NBnb6pqGkifgC8rC.jpg"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-12 10:42:16', NULL, NULL, 1),
