	(432, 'P2019111313_DM_A', 0, '申达', NULL, 'D', 'M', 'A', '申达UN机型弘讯标准程序修改', '修改要求：在申达UN机型标准程序中，修改两个PC点。<br/>                 1.PC21点，将“关模低压”改为“第二段冷却器”；<br/>                 2.PC27点，将“安全阀”改为“第三段冷却器”。<br/>                 3.IO88扩展模块中，将冷却器选项中的PC41（第二段冷却器）至PC48（第九段冷却器）这8个PC点，改为PC41(第四段冷却器)，PC42(第五段冷却器)，<br/>                    PC43(第六段冷却器)，PC44(第七段冷却器)，PC45(第八段冷却器)，PC46(第九段冷却器)，PC47,PC48空置。<br/><br/>申达-周工<zhoux@injectionmachine.com>', '沈航凯', '沈航凯,王涛', NULL, NULL, '未选择', '2019-11-13', '2019-11-19', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-13', '2019-11-13', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-13 16:43:26', NULL, NULL, 1),
	(433, 'P2019111401_DM_A', 0, '杭州大禹', NULL, 'D', 'M', 'A', 'TK600.BMC.J-190528', '在此程序上修改一下要求:<br/>1.增加X08允许顶针，顶针前判断ON顶针动作OFF时等待；<br/>2.Y54全自动开模到位输出，手动半自动开模到位不输出；<br/>3.X17机械手2开模到位判断0N-OFF-ON过才允许下一模自动。<br/>以上点位只有座台画面机械手选择使用有效，关闭无效。<br/>麻烦你在2019年11月14号回复<br/>韩智敏', '陈浩天', '陈浩天', NULL, NULL, '未选择', '2019-11-14', '2019-11-17', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-14', '2019-11-14', 1, NULL, NULL, NULL, '[{"fileName":"微信图片_20191114080238.jpg","fileKey":"EX7Gjaum2Ok7x_p-nGu1p1je.jpg"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-14 08:23:11', NULL, NULL, 1),
