	(436, 'P2019111403_DM_B', 0, '佳明', NULL, 'D', 'M', 'B', '佳明HYB3油电程序修改', '佳明HYB3油电程序在此版本上主机：1970-0013-0705  面板为：7CM-F83-1937做以下修改：<br/>1、增加一组吹气（原为8组吹气，现修改为9组吹气）<br/>   手动情况下： 吹气增加强制输出功能即在吹气功能画面里，每组开放一组强制选项（使用不使用），使用时该组吹气强制输出；<br/>2、手动情况下：射出速度默认走调模速度，但需增加一个功能选项（可选择走调模速度或画面设定速度-方便厂内试车及试机）<br/><br/>贺强华<sd.rd02@techmation.com.cn>', '梅迪凡', '许静静,梅迪凡', NULL, NULL, '未选择', '2019-11-14', '2019-11-20', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-14', '2019-11-14', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-14 09:23:47', NULL, NULL, 1),
