	(511, 'P2019112102_DM_A', 0, '杭州大禹', NULL, 'D', 'M', 'A', 'TY1600.3R.SF-180145', '输出<br/>1、自动准备好： 全自动模式并能正常注塑时输出； Y17全自动信号<br/>2、磨具顶升到位：顶升神出到位输出；             Y18顶进完成<br/>3、请求上料：顶升伸出到位并且检测没有物料输出，当收到上料完成后此信号关闭； Y29允许放件<br/>4、请求取成品：顶升伸出到位并且检测到是注塑完成的物料时输出，当收到取料完成后此信号关闭；    Y29允许取件<br/>输入<br/>1、上料完成：上下料位上好物料启动注塑机旋转注塑（取代手动按钮）；X25放件完成<br/>2、取料完成：把注塑机注好的成品取走时输出。   X26  取件完成<br/>3、区域释放： （机器人夹具进人注塑区时为“0” 此时注塑转盘不能运转，铁芯托盘不能下降）。X27允许顶退<br/>4. X28物料检测:转盘到位顶针进终X28为ON状态输出允许取件,OFF状态输出允许放件(检测到信号增加0.2秒延时后再输出)顶退前判断X28为ON状态.<br/>麻烦你在2019年11月22号回复  韩智敏<br/>', '陈浩天', '陈浩天', NULL, NULL, '未选择', '2019-11-21', '2019-11-24', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-21', '2019-11-21', 1, NULL, NULL, NULL, '[{"fileName":"微信图片_20191120150427.jpg","fileKey":"wDTpQtkEQHLGWh-llwLE-8UT.jpg"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-21 10:08:28', NULL, NULL, 1),
	(512, 'P2019112103_DM_A', 0, '丰铁', NULL, 'D', 'M', 'A', ' F11 F13 F15 F17四个版本统一做程序功能完善修改需求-Q8A Q12A', '以上程序版本基础上，烦请帮忙修改下列三个功能，谢谢！完整版本更新，配置版本不能受影响。<br/>要求一、座台-参数页面的，ABC夹延迟关时间，三笔资料，分别移动到对应水口机械手时间资料下方，方便调整。默认值可给0。<br/>要求二、移模-参数页面，增加转塔下降慢速位置下限“0-转塔最大位置”区间可调。默认值可给0。<br/>例如参数页面下限设定70MM，外页的转塔下降慢速位置下限变成70-转塔最大位置”区间可调。防止客户模具下降到0位，损坏工件。<br/>要求三、移模-参数页面，增加PLC移模速度上限“0-10万”区间可调。默认值可给0。<br/>例如参数页面上限设定6万，移模速度上限变成0-6万区间可调。防止客户移模速度设定太大过载。', '虞晔文', '虞晔文,虞晔文,虞晔文', NULL, NULL, '未选择', '2019-11-21', '2019-11-26', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-21', '2019-11-21', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 3, 3, 1, 100, '2019-12-11', 0, '2019-11-21 10:30:27', NULL, NULL, 1),
	(513, 'P2019112104_DM_B', 0, '宏星', NULL, 'D', 'M', 'B', '湖州宏星液压摆辗机方案', '1、主画面增加主系统、主缸、左前静压、左后静压、右前静压、右后静压的实时值和最大值柱状图显示。<br/>2、监测二画面增加滑块位置最小值、主系统压力最大值、主缸压力最大值、左前静压最大值、左后静压最大值、右前静压最大值、右后静压最大值、摆辗次数。', '张磊', '张磊,王涛', NULL, NULL, '未选择', '2019-11-21', '2019-11-30', '谢丽君', '谢丽君', NULL, 'APP-DSP55-TECH580', '未选择', '2019-11-21', '2019-11-21', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-21 10:31:53', NULL, NULL, 1),
	(514, 'P2019112105_DM_A', 0, '台州科力', NULL, 'D', 'M', 'A', '60双伺服程序修改', '由于我们机器在工艺上的改进，想把程序做以下修改：<br/>1：螺杆动作顺序做修改，以前是注射---保压---预塑---防涎，现改为预塑---（喷嘴开）---注射---保压---防涎；<br/>2：喷嘴开这个动作加一个时间，即喷嘴开先工作设定的时间，然后再进行注射，保压，防涎动作，做这些动作的时候，喷嘴开一直进行，直到这些动作结束后，喷嘴开停止输出。<br/>这个时间的作用就是让喷嘴能够有时间充分打开。<br/>3：全自动时，合模到位后就进行预塑，不用等高压结束。<br/>4：以前程序中输出点的第30点是喷嘴关，改为喷嘴开。<br/>要修改的程序编号应该是190F-3066-0318.55。面板程序是F71的。<br/><br/>科力_郑晓杰<407422670@qq.com>', '张磊', '张磊,俞洋', NULL, NULL, '未选择', '2019-11-21', '2019-11-26', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-21', '2019-11-21', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 1, 1, 30, NULL, 0, '2019-11-21 10:59:35', NULL, NULL, 1),
