	(521, 'P2019112111_DM_A', 0, '鹰图', NULL, 'D', 'M', 'A', '鹰图直压机程序修改', '主机：190F-020A-0909.55<br/>面板：完整版：7YR_F71_199B<br/>此版本还需如下修改：<br/>1：粗调模状态下，按调模进退按键能做调模进退动作<br/>2：自动调模状态下，如果安全门开，需报警安全门未关，切动作<br/>3：主画面调模电子尺需显示实际位置，比如 自动调模对话框输入实际位置350，则自动调模结束，调模电子尺需显示350的位置，也就是目前程序中的目标位置（实际电子尺长度）+最小模厚计算出的结果显示<br/>4：在自动调模或者手动调模过程中，检测到调模进终或者退终，则停止动作并报警。', '柳张成', '柳张成,张铖', NULL, NULL, '未选择', '2019-11-21', '2019-11-27', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-21', '2019-11-21', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-21 16:34:21', NULL, NULL, 1),
