	(526, 'P2019112201_DM_A', 0, '恩瑞德', NULL, 'D', 'M', 'A', '恩瑞德程序修改', '主机：<br/>1.增加切刀寻零功能<br/>手动下按备用一，检查切刀零位，若有信号则输出PC切刀归零，等待驱动器反馈归零完成<br/>若无信号则送模拟量给切刀电机，当限位有信号时再输出PC切刀归零<br/>2.手动下切刀动作<br/>按备用二按键，PC切刀和模拟量，等到切刀到达零位后停止输出<br/>3.挤出位置到后，自动做切刀动作<br/>4.增加挤出保护，当切刀不在零位时，不输出挤出模拟量<br/><br/>面板：<br/>1.模座调机画面开放开关模速度上限<br/>2.面板重排<br/>3.配合主机修改新功能', '孙维泽', '孙维泽,俞洋', NULL, NULL, '未选择', '2019-11-22', '2019-11-29', '谢丽君', '谢丽君', NULL, 'APP-DSP55-TECH530', '未选择', '2019-11-22', '2019-11-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-22 08:51:31', NULL, NULL, 1),
