	(532, 'P2019112207_DM_A', 0, '泰瑞', NULL, 'D', 'M', 'A', '泰瑞程序修改-三包程序', '请在附件版本程序上修改，增加三包时间设置，时间单位月，版本画面增加一栏显示三包到期时间。起始时间与到期时间一旦生成，不能去除，除非改程序或换面板，程序请在11月25日完成，谢谢！', '王锋', '王锋,王锋', NULL, NULL, '未选择', '2019-11-22', '2019-11-25', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-22', '2019-11-22', 1, NULL, NULL, NULL, '[{"fileName":"IMG_20191122_095952.jpg","fileKey":"zJ5aNiZcU6nBAypJpd8kjlel.jpg"},{"fileName":"IMG_20191122_100319.jpg","fileKey":"oaOMJk_HIGaYvd0LXpMZ0T1l.jpg"}]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-22 11:38:07', NULL, NULL, 1),
