	(535, 'P2019111906_DW_A', 1, '余姚朗格', NULL, 'D', 'W', 'A', '朗格程序修改', '主机：<br/>1.PB水压检测<br/>手动下有信号，报警停动作<br/>自动下有信号，这一模做完报警停动作<br/>2.加4组风冷<br/>3.4组电动中子，加功能选项<br/>中子B进可跟随中子A进<br/>中子B退可跟随中子A退<br/>中子D进可跟随中子C进<br/>中子D退可跟随中子C退<br/>4.安全确认键(循环启动键)<br/>5.增加开模辅助功能，其他版本上做过<br/><br/>面板：<br/>射出所有页面和电子尺行程页面设置新密码', '孙维泽', '孙维泽,戎桂', NULL, NULL, '未选择', '2019-11-19', '2019-11-26', '谢丽君', '谢丽君', NULL, 'APP-DSP54-PILOT 3/3A/3S', 'APP-PXA270-M12-54', '2019-11-22', '2019-11-22', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-22 16:15:10', NULL, NULL, 1),
