	(537, 'P2019112501_DM_A', 0, '震海誉', NULL, 'D', 'M', 'A', '增加温度自学习功能', '增加温度自学习功能', '赵韦', '柳张成,赵韦', NULL, NULL, '未选择', '2019-11-25', '2019-11-28', '谢丽君', '谢丽君', NULL, '未选择', 'APP-PXA270-Q8-54', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[{"fileName":"微信图片_20191122210822.jpg","fileKey":"DPtZTPx99ehjuqSaKYy58gg3.jpg"},{"fileName":"震海誉程序修改.docx","fileKey":"woEXEJHuL49k0KpBfgjzziT5.docx"}]', 0, '无', NULL, 0, 2, 2, 1, 100, '2019-12-11', 0, '2019-11-25 08:21:57', NULL, NULL, 1),
	(538, 'P2019112502_DM_A', 0, '利鑫华', NULL, 'D', 'M', 'A', '程序修改', '现有注塑机（HTL-730），电控改造需要程式修改，请给予技术支持，谢谢！要求如下<br/>机型：TECH2H，主机版本：TM标准程式.   面版板本：7IL-B11-195O。<br/>1.PB开放：驱动器异常，后安全门，储能检知。<br/>2.PC开放：1.驱动器重置，使能，开模快速。<br/>                 2.注射储料（同注射，储料动作同时通断），零背压（储料时：当选择零背压功能，同储料法同时通断）。<br/>                 3.开门阀（手动时：同开模动作同时输出，时间到开门阀断开。半自动时：冷却开始开门阀输出，时间到开门阀断开。开门阀为气动元件无需压力速度信号输出）。<br/>                  4.储能阀（当PB储能检知点有信号时储能阀输出，反之断开。储能阀输出时无需压力速度输出），<br/>                  5.增加的PC点可借用24‘25’26‘27’28‘30号点。<br/>3.系统压160，显示在主画面（第8通道）<br/>   <br/>如有不清楚之处请电话联系：13906057707       厦门市利鑫华轻工机械有限公司 -余攀耀   2019年11月23日<br/>', '沈航凯', NULL, NULL, NULL, '未选择', '2019-11-25', '2019-11-28', '谢丽君', '谢丽君', NULL, 'APP-DSP54-TECH 2/2S', 'APP-PXA270-Q8-54', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[]', 0, '', NULL, 0, 0, 0, 1, 10, NULL, 0, '2019-11-25 08:55:06', NULL, NULL, 1),
	(539, 'P2019111903_DM_A', 1, '双盛/圣特龙', NULL, 'D', 'M', 'A', '增加温度自学习功能', '增加温度自学习功能', '俞洋', '俞洋', NULL, NULL, '未选择', '2019-11-19', '2019-11-27', '谢丽君', '谢丽君', NULL, '未选择', 'APP-PXA270-Q8-54', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[{"fileName":"双盛程序修改20191119doc.doc","fileKey":"uQaYVrfHq1SJ0zJSEi7NixBb.doc"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-25 08:58:12', NULL, NULL, 1),
	(540, 'P2019112503_DM_A', 0, '弘讯标准', NULL, 'D', 'M', 'A', '伊朗办程序修改', '烦请在此程序做如下修改<br/>1：做开模动作时请先检查模座是否在开模第一段，如果否则不作动作，如果是请只输出PC26 并按照面板设定的压力流量和动作时间完成开模动作<br/>2：当处于调模状态时，按开模按键请只输出PC3，按关模请只输出PC1，其他不变。<br/>3：当关模动作中，打开安全门时，请只切掉关模阀和关模动作压力流量并报警安全门开，不需要做开模动作返回开模终。<br/>4：请把pc31改为储料背压阀，当面板选择使用储料背压时，储料动作PC31有输出，选择不使用背压时则无输出。<br/><br/>陈俊桥<techme@techmation.com.tw>  ', '柳张成', '柳张成', NULL, NULL, '未选择', '2019-11-25', '2019-11-29', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-25 09:08:56', NULL, NULL, 0),
	(541, 'P2019112504_DM_A', 0, '双盛/圣特龙', NULL, 'D', 'M', 'A', '双盛410程序更改', '双盛之前更改过程序，拖模走位置，改了主机。<br/>由于大机需要单比例和比例背压，比例背压在第三通道。现在面板需要开放单比例通道选择功能。面板：7ST 611 17CR 急着发机！<br/>客服部-梅凯辉<mkh0313@163.com>', '俞洋', '俞洋', NULL, NULL, '未选择', '2019-11-25', '2019-11-28', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[{"fileName":"双盛410程序更改.eml","fileKey":"T_vzXPjA2SpVDNwbGehEvLX1.eml"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-25 09:10:49', NULL, NULL, 1),
	(542, 'P2019112503_DM_A', 1, '弘讯标准', NULL, 'D', 'M', 'A', '伊朗办程序修改', '烦请在此程序做如下修改<br/>1：做开模动作时请先检查模座是否在开模第一段，如果否则不作动作，如果是请只输出PC26 并按照面板设定的压力流量和动作时间完成开模动作<br/>2：当处于调模状态时，按开模按键请只输出PC3，按关模请只输出PC1，其他不变。<br/>3：当关模动作中，打开安全门时，请只切掉关模阀和关模动作压力流量并报警安全门开，不需要做开模动作返回开模终。<br/>4：请把pc31改为储料背压阀，当面板选择使用储料背压时，储料动作PC31有输出，选择不使用背压时则无输出。<br/><br/>陈俊桥<techme@techmation.com.tw>  ', '柳张成', '柳张成', NULL, NULL, '未选择', '2019-11-25', '2019-11-29', '谢丽君', '谢丽君', NULL, '未选择', '未选择', '2019-11-25', '2019-11-25', 1, NULL, NULL, NULL, '[{"fileName":"程序修改申请.eml","fileKey":"pdB3mkV_rLUIPUi3zS6gj9eG.eml"}]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-25 09:13:10', NULL, NULL, 1),
