	(566, 'P2019112702_DM_A', 0, '杭州爱科', NULL, 'D', 'M', 'A', 'AK-3500程序修改', '1、PB50左安全杆进终，PB91右安全杆进终；开模结束延迟检测安全杆进信号，时间到后警报停止动作。（当前7AK_601面板程式未开此资料，需更新面板）。<br/>2、安全罩电眼强制保护中子进和顶针退。<br/>3、机器闲置切电热时（时间参数使用“转半温后切电热时间”），需做自动清料一次才可进入自动。', '张磊', '张磊,虞晔文', NULL, NULL, '未选择', '2019-11-27', '2019-11-30', '谢丽君', '谢丽君', NULL, 'APP-DSP54-C7000', '未选择', '2019-11-27', '2019-11-27', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-27 12:55:32', NULL, NULL, 1),
	(567, 'P2019112703_DM_A', 0, '杭州爱科', NULL, 'D', 'M', 'A', '常州客户AT-550-2R增加自动化信号', '要求：1、增加PB35  转盘安全，PB36  急停，PB37  全自动启动，PC35  定位进结束，PC36  开模到位，PC37  顶进到位，PC38  顶退到位；2、PB35  转盘安全信号在手动、半自动、全自动状态下，做转盘动作时，检测该信号是否“ON”，若信号“OFF”这警报提示转盘安全异常，PC警报不用输出，若在半自动或者全自动不切换至手动，待信号复位后警报自动消除继续保持输出；3、PB37  全自动启动信号在全自动模式下有效，第一模不需要监测该信号，在第二开始前监测该信号是否“ON”，若“ON”则开始循环下一模，请尽快帮忙修改下，4、需要修改画面字串添加一个配置版。', '张磊', '张磊', NULL, NULL, '未选择', '2019-11-27', '2019-11-30', '谢丽君', '谢丽君', NULL, 'APP-DSP54-PILOT 3/3A/3S', '未选择', '2019-11-27', '2019-11-27', 1, NULL, NULL, NULL, '[]', 0, '无', NULL, 0, 1, 1, 1, 100, '2019-12-11', 0, '2019-11-27 12:56:46', NULL, NULL, 1),
