	(13, 'P2019102206_DT_A', 'T2019102206_DK_03', 'TP2019102201_DP_C', 0, '海达', 'D', 'P', 'C', '更新程序，优化润滑灯显示', '计划单要求:<br/>更新程序，优化润滑灯显示<br/> 任务单要求:<br/>润滑状态处理，使用subs2给面板传值，STNC.LUBR_SELE在润滑做完，要清掉', '张磊', '张磊', NULL, NULL, '普通机', '2019-10-22', '2019-10-25', '许静静', '张磊', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '2019-10-22', '2019-10-22', 1, NULL, NULL, NULL, '[]', 1, '张磊', '有', 1, 1, 1, 1, 100, '2019-11-07', '2019-10-22 14:20:44', 0, NULL, NULL, 1),
	(14, NULL, NULL, 'TP2019102501_DM_C', 0, '弘讯标准', 'D', 'M', 'C', 'bug修正', '在所有页面touch空白的地方，过一定时间（约5s），会出现一个”删除”的按键键值，在PC页面强制输出后，如果收到“删除”键值，则会取消强制输出。', '周永汉', '周永汉', NULL, NULL, '未选择', '2019-10-25', '2019-10-28', '蒋伟贞', '孙凌财', NULL, '未选择', 'Kernel-3354-Q12-PLC', '2019-10-25', '2019-10-25', 1, NULL, NULL, NULL, '[{"fileName":"TMC004软件变更申请单_tm3354（mmi）-20191025.doc","fileKey":"qnnAJDFVpobHm3gOLIposLRu.doc"}]', 1, '唐奕磊', '有', 1, 1, 1, 1, 40, NULL, '2019-10-25 09:21:08', 0, NULL, NULL, 1),
	(15, NULL, NULL, 'TP2019111301_DM_C', 0, '海雄', 'D', 'M', 'C', 'PB关模终增加滤波', '海雄测试发现当液压安全阀工作时会短暂干扰关模终，目前工程还没查到原因，<br/>先软体增加滤波处理，故申请核心对关模终增加10ms滤波。<br/>', '张磊', '张磊', NULL, NULL, '普通机', '2019-11-13', '2019-11-14', '许静静', '许静静', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '2019-11-13', '2019-11-13', 1, NULL, NULL, NULL, '[]', 1, '杨勇', '有', 1, 1, 1, 1, 40, NULL, '2019-11-13 13:09:07', 0, NULL, NULL, 1),
	(16, '', '', 'TP2019111501_DM_C', 0, '海天', 'D', 'M', 'C', '54系统HT-核心功能修改申请开单;', '54系统三板机，开模终状态，粗调开模仍会输出瞬间的油压和阀节点<br/>54系统三板机，开模终状态，粗调开模仍会输出瞬间的油压和阀节点<br/>修改为：54系统三板机，开模终状态，粗调开模不能输出油压和发节点', '张凯', '张凯', 'undefined', NULL, '普通机', '2019-11-15', '2019-11-18', '许静静', '李斌', NULL, 'Kernel-DSP54-7100（7HT卧式机）', '未选择', '2019-11-15', '2019-11-15', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 1, 1, 1, 40, NULL, '2019-11-15 08:13:24', 0, NULL, NULL, 1),
	(17, NULL, NULL, 'TP2019111502_DM_C', 0, '海天', 'D', 'M', 'C', '55核心逻辑修改申请开单', '开模中途中子动作的开模计时<br/>54系统开模计时：前面开模时间+中子动作+后面开模时间<br/>55系统开模计时：后面开模时间<br/><br/>55系统更改为：54系统一样：前面开模时间+中子动作+后面开模时间<br/><br/><br/>2. 开模完延迟计时（MACH.OPNM_END_DLY）不计入开模总计时。<br/>', '张凯', '张凯', NULL, NULL, '普通机', '2019-11-15', '2019-11-18', '许静静', '李斌', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '2019-11-15', '2019-11-15', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 1, 1, 1, 40, NULL, '2019-11-15 08:15:52', 0, NULL, NULL, 1),
	(18, NULL, NULL, 'TP2019111503_DM_C', 0, '海天', 'D', 'M', 'C', '55核心修改开单申请', '使用FLAG，特殊控制：复合机关模定位到低压终位置。', '张凯', '张凯', NULL, NULL, '普通机', '2019-11-15', '2019-11-18', '许静静', '李斌', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '2019-11-15', '2019-11-15', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 1, 1, 1, 40, NULL, '2019-11-15 08:16:58', 0, NULL, NULL, 1),
	(19, NULL, NULL, 'TP2019111504_DM_C', 0, '海天', 'D', 'M', 'C', '关于二板机中途中子---55核心问题修正', '二板机存在以下现象：<br/>1、设多组中途中子，自动情况下，若关模冲至负值，此时存在做完第一个中子，直接跳过后续中子动作，并假死在高压结束。<br/>2、手动情况下，模板位与低压终结束后的位置，此时的手动做关模，不检测中途中子进终状态，进入下一个动作<br/><br/>更改为如下：<br/>1、全自动下，中途中子在符合有效区前提下，全部动作结束再进入下一动作。<br/>2、手动关模&进自动时，模板位于”中子进位置~负有效位置”之间时动作，小于负有效位置或小于0报警中子进终未到位<br/>', '张凯', '张凯', NULL, NULL, '二板机', '2019-11-15', '2019-11-18', '许静静', '李斌', NULL, 'Kernel-DSP55-5100（卧式机）', '未选择', '2019-11-15', '2019-11-15', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 1, 1, 1, 40, NULL, '2019-11-15 13:41:14', 0, NULL, NULL, 1),
	(21, NULL, NULL, 'TP2019112001_DM_A', 0, '海天', 'D', 'M', 'A', '开模完延迟计时逻辑修改和开模终点位置采样相关', '开模完延迟计时（MACH.OPNM_END_DLY）不计入开模总计时，请安排加入54、55标准出货版本，谢谢！<br/> 同时，55的开模终点位置采样，也需同步54。', '张凯', '张凯', NULL, NULL, '未选择', '2019-11-20', '2019-11-23', '李斌', '许静静', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '2019-11-20', '2019-11-20', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 1, 1, 1, 40, NULL, '2019-11-20 08:32:49', 0, NULL, NULL, 1),
	(119, NULL, NULL, 'TP2019112002_DM_A', 0, '海天', 'D', 'M', 'A', '进料口切断和中子相关-功能修改', '进料口切断选择使用，正常的顶出只会检查一次，检测到中子退终后，之后无论中子状态如何变化都不会再检测，不是实时检查，实时检查有另外的CODE@f2-2000。全自动过程中做进料口动作进时切手动后，可以开模，但中子和托模会互锁，需要调模状态下将托模退到位。', '张凯', '张凯', NULL, NULL, '未选择', '2019-11-20', '2019-11-23', '李斌', '许静静', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '2019-11-20', '2019-11-20', 1, NULL, NULL, NULL, '[]', 1, '李斌', '有', 1, 0, 0, 1, 20, NULL, '2019-11-20 09:28:34', 0, NULL, NULL, 1),
	(120, NULL, NULL, 'TP2019112003_DM_C', 0, '海雄', 'D', 'M', 'C', '7100核心需要增加功能', '     7100核心需要增加：在粗调开模时，给个FLG=1时，粗调开模不检查位置。<br/>     这样XPLC可以通过这个FLG操作粗调开模。<br/>', '张磊', '张磊', NULL, NULL, '普通机', '2019-11-20', '2019-11-23', '许静静', '许静静', NULL, 'Kernel-DSP54-7100（卧式机）', '未选择', '2019-11-20', '2019-11-21', 1, NULL, NULL, NULL, '[]', 1, '杨勇', '有', 1, 1, 1, 1, 40, NULL, '2019-11-20 12:48:55', 0, NULL, NULL, 1),
	(121, NULL, NULL, 'TP2019112004_DM_C', 0, '弘讯标准', 'D', 'M', 'C', 'zoom属性功能修改', '画面下方toolbar栏，CtmToolButton元件有一个zoom属性（选择后将字体放大），现在的放大方式使得原来居中的字体不再居中，放大后画面看起来不协调。', '周永汉', '周永汉', NULL, NULL, '未选择', '2019-11-20', '2019-11-25', '蒋伟贞', '孙凌财', NULL, '未选择', 'Kernel-3354-Q12-55', '2019-11-20', '2019-11-20', 1, NULL, NULL, NULL, '[{"fileName":"TMC004软件变更申请单_tm3354（mmi）.doc","fileKey":"mOlizikCE2n6IrWHFNrY8AJV.doc"}]', 1, '唐奕磊', '有', 1, 1, 1, 1, 40, NULL, '2019-11-20 15:25:04', 0, NULL, NULL, 1),
