	(123, NULL, NULL, 'TP2019112701_TM_A', 0, '弘讯标准', 'T', 'M', 'A', 'os loading画面增加琮伟专用的画面', '客戶要求更改Q12面板LOADING畫面為琮偉專屬畫面，相關畫面請參照M12/270面板系統。<br/>下次出货时一并更新，无需主动更新。', '周永汉', NULL, NULL, NULL, '未选择', '2019-11-27', '2019-11-30', '蒋伟贞', '孙凌财', NULL, '未选择', 'OS-3354-3.2', '2019-11-27', '2019-11-27', 1, NULL, NULL, NULL, '[{"fileName":"20191127F_01_T0_琮偉軟體變更申請單.doc","fileKey":"Rx_JPkBPRU3KVXgrrkc6RivT.doc"}]', 0, NULL, '无', 0, 0, 0, 1, 0, '2019-11-28', '2019-11-27 14:21:53', 1, NULL, NULL, 1),
