	(54, 'T2019100812_DA_01', 0, 'P2019100812_DW_A', '[{"fileName":"X7EA72746.JA8","fileKey":"b7_b1693rsb0Z9lt_iSyyOdh.JA8"}]', '谷永亮', '2019-10-08', '张磊', '2019-10-08', '点位修改：<br/>PB22:定位完成<br/>功能修改：<br/>1.定位原走系统压力流量修改至特殊托模方式控制。<br/>2.增加自动化流程。全自动下，检测到允许转模1，2后；转模，转模完成，输出转模完成1，2；等待检测到允许托模后，走定位进动作，定位进到定位完成后，输出托模完成1，2。（定位不影响其它动作，即同步）<br/>3.定位修改为托模定位同步功能，备用一二用作托模进功能，托模退功能。<br/>4.手动下，只有检测到定位进终时，才可做托模进。<br/>5.手动下，检测到定位进终时，不可做托模退。<br/>6.转模前检测，转盘光栅，若未检测到，等待动作。', '点位修改：<br/>PB22:定位完成<br/>功能修改：<br/>1.定位原走系统压力流量修改至特殊托模方式控制。<br/>2.增加自动化流程。全自动下，检测到允许转模1，2后；转模，转模完成，输出转模完成1，2；等待检测到允许托模后，走定位进动作，定位进到定位完成后，输出托模完成1，2。（定位不影响其它动作，即同步）<br/>3.定位修改为托模定位同步功能，备用一二用作托模进功能，托模退功能。<br/>4.手动下，只有检测到定位进终时，才可做托模进。<br/>5.手动下，检测到定位进终时，不可做托模退。<br/>6.转模前检测，转盘光栅，若未检测到，等待动作。', NULL, 'X7EA72746.JA8', NULL, '已登记,已审核', '2019-10-08 14:40:48'),
