	(1, 'TT2019092903_HO_01', 0, 'TP2019092903_DM_C', '[{"fileName":"3354_B_199Q_20190926.tib","fileKey":"gKlYwhb42Dyln_JsKAHlF1gQ.tib"}]', '周永汉', '2019-09-29', '蒋伟贞', '2019-10-08', '3354_B_199Q_20190926烧录档修改内容：<br/>    <br/>1、在3354_B_1995_20190905版本基础上修改；<br/>2、增加电阻屏的驱动；<br/>2、switch version增加TM 8inch电阻屏的相关参数切换；<br/>3、bootmenu修改：可通过厂商和版本来切换到TM 8寸电阻屏（厂商代码=7TM，版本=8R，日期不限）；', '3354_B_199Q_20190926烧录档可兼容电阻屏', NULL, '3354_B_199Q_20190926.tib', NULL, '已登记,已审核', '2019-09-29 17:48:40'),
	(2, 'TT2019101101_HK_01', 0, 'TP2019101101_DP_C', '[{"fileName":"mmi","fileKey":"QmcSRJiL0-8PQcD2nMQpjQtG"}]', '周永汉', '2019-10-11', '蒋伟贞', '2019-10-11', '1、mmi修改支持鼠标功能；<br/>2、解决鼠标连着，触摸操作会异常、触摸操作会导致鼠标箭头位置乱跳的问题。<br/>原app程序中读取/dev/input/mice来获得鼠标信息。mice是所有鼠标的合体，所有鼠标信息都会发给它一份，由于电容屏会被驱动识别为mouse设备，在触摸操作时会往mice中也写入信息，导致上述问题。现更正为自动查找并抓取"/dev/input/mouseX"，X=0、1……', '支持USB鼠标', NULL, 'mmi', NULL, '已登记,已审核', '2019-10-11 10:02:28'),
	(3, 'TT2019101102_DK_01', 0, 'TP2019101102_DP_C', '[{"fileName":"7TM-V7100-JAB.rar","fileKey":"ZfmfoY1LMg2Pj6_gr1KOaHzG.rar"}]', '张磊', '2019-10-11', '张磊', '2019-10-11', '(191011)1、功能新增：OPT_OPN_SPC 新增/8-OPN1,2,3,4。<br/>           来源：孙维泽', '无', NULL, '7TM-V7100-JAB.rar', NULL, '已登记,已审核', '2019-10-11 11:07:33'),
	(4, 'TT2019101201_HO_01', 0, 'TP2019101201_DM_A', '[{"fileName":"9TM_3354_19AB_update.rar","fileKey":"UmLAqJ9qcruv7pkB1SsnkKxh.rar"}]', '傅霞银', '2019-10-14', '傅霞银', '2019-10-14', '1. 可输入数字和字母的edit元件，触摸输入时，弹出的小键盘用全键盘显示；删去取消键，原来无作用；<br/>2. 语言切换，button元件，字串改为中文/英文；<br/>3. OS的版本，不在bootmenu的config.ini中指定，改为读取/etc/os_info中的OS版本信息；<br/>4. 增加按键截图功能；', '可输入数字和字母的edit元件，触摸输入时，弹出的小键盘用全键盘显示；', NULL, '9TM_3354_19AB_update.rar', NULL, '已登记,已审核', '2019-10-14 08:20:14'),
	(5, 'TT2019101201_HO_01', 1, 'TP2019101201_DM_A', '[{"fileName":"9TM_3354_19AE_update.rar","fileKey":"A38wJNFcfD0FgPElOWZK1_pf.rar"}]', '傅霞银', '2019-10-14', '傅霞银', '2019-10-14', '1. 可输入数字和字母的edit元件，触摸输入时，弹出的小键盘用全键盘显示；删去取消键，原来无作用；<br/>2. 语言切换，button元件，字串改为中文/英文；<br/>3. OS的日期，不在bootmenu的config.ini中指定，改为读取/etc/os_info（B版）或/etc/os_version（A版）中的OS_VERSION；<br/>4. 增加按键截图功能；', '可输入数字和字母的edit元件，触摸输入时，弹出的小键盘用全键盘显示；', '1）OS的日期，不在bootmenu的config.ini中指定，改为读取/etc/os_info（B版）或/etc/os_version（A版）中的OS_VERSION；<br/>  这样处理，不必修改之前判断/etc/os_info文件，来区分A/B版的所有地方，只需在statusbar0.cpp增加OS日期的读取；<br/>2）不改变form的文件夹名，否则在前一版本bootmenu，单独更新bootmenu后，因找不到对应目录的msgbox_prompt.txt，不会弹出msgbox；<br/>3）截图按键，只处理截图功能，不要把键值传给元件；（tmTaskCmd.cpp，在非PA画面，把键值改为_NULL_KEY）', '9TM_3354_19AE_update.rar', NULL, '已登记,已审核', '2019-10-14 12:58:04'),
