REPLACE INTO `ppm_testcontents` (`DBID`, `taskSortType`, `taskType`, `modelType`, `content`, `billType`, `billVersion`, `orderNum`, `saveTimeStamp`) VALUES
	(1, 'H', 'A', '检查当机', '切换语言是否会当机，画面是否变为所切换的语言；', 'IPQC', 0, 1, '2019-10-10 00:00:00'),
	(2, 'H', 'A', '检查当机', '切换画面（含快捷链接toolbar），是否会当机，或与主机通讯中断；', 'IPQC', 0, 1, '2019-10-10 00:00:00'),
	(3, 'H', 'A', '检查新开放资料', '新开放资料-切换页面是否保存 ；', 'IPQC', 0, 2, '2019-10-10 00:00:00'),
	(4, 'H', 'A', '检查新开放资料', '新开放资料-上下限、精度、默认值、地址是否正确；', 'IPQC', 0, 2, '2019-10-10 00:00:00'),
	(5, 'H', 'A', '检查新开放资料', '新开放资料-资料/地址是否重复；', 'IPQC', 0, 2, '2019-10-10 00:00:00'),
	(6, 'H', 'A', '检查新开放资料', '新开放资料-字串显示是否正确', 'IPQC', 0, 2, '2019-10-10 00:00:00'),
	(7, 'H', 'A', '检查新开放资料', '新开放资料-快设画面是否同步（有需要时）；', 'IPQC', 0, 2, '2019-10-10 00:00:00'),
	(8, 'H', 'A', '检查画面', '画面不可有65535，上下限也不可有65535；', 'IPQC', 0, 3, '2019-10-10 00:00:00'),
	(9, 'H', 'A', '版本信息', '检查版本画面HMI版本号、日期是否正确；', 'IPQC', 0, 4, '2019-10-10 00:00:00'),
	(10, 'H', 'A', '检查图片', '图片显示是否正确，图片是否清晰，单词拼写是否正确；（含开机Logo）', 'IPQC', 0, 5, '2019-10-10 00:00:00'),
	(11, 'H', 'A', '检查Toolbar', '检查Toolbar链接是否正确，是否可进入对应的画面；（含快捷链接）', 'IPQC', 0, 6, '2019-10-10 00:00:00'),
	(12, 'H', 'A', '检查通讯', '检查通讯是否正常；', 'IPQC', 0, 7, '2019-10-10 00:00:00'),
	(13, 'H', 'A', '检查记录页面', '参数修改记录画面各栏位是否正确；', 'IPQC', 0, 8, '2019-10-10 00:00:00'),
	(14, 'H', 'A', '检查标准化', '手动&粗调模式下，应可对各电子尺进行归零；', 'IPQC', 0, 9, '2019-10-10 00:00:00'),
	(15, 'H', 'A', '检查标准化', '自动/半自动时，无法进入参数画面，提示字串需更新为“请在手动/粗调模状态执行”；', 'IPQC', 0, 9, '2019-10-10 00:00:00'),
	(16, 'H', 'A', '检查标准化', '温度PID在任何状态下都可输入密码进入；', 'IPQC', 0, 9, '2019-10-10 00:00:00'),
	(17, 'H', 'A', '检查警报', '系统产生警报，看警报记录是否正常；', 'IPQC', 0, 10, '2019-10-10 00:00:00'),
	(18, 'H', 'A', '检查警报', '警报记录--翻页断电是否保存；', 'IPQC', 0, 10, '2019-10-10 00:00:00'),
	(19, 'H', 'A', '检查警报', '警报记录--是否可被重置；', 'IPQC', 0, 10, '2019-10-10 00:00:00'),
	(20, 'H', 'A', '检查警报', 'Error2功能是否已添加；', 'IPQC', 0, 10, '2019-10-10 00:00:00'),
	(21, 'H', 'A', '检查警报', '循环警报功能是否正常；', 'IPQC', 0, 10, '2019-10-10 00:00:00'),
	(22, 'H', 'A', '检查监测', '自动循环后，检查监测画面传值是否正确；', 'IPQC', 0, 11, '2019-10-10 00:00:00'),
